import React from 'react';
import { Container } from 'react-bootstrap';
import axios from 'axios';
class PokeContainer extends React.Component {
    
    render() {
        return (
            <div>
                <Container>
                    <h1>Pokemons Container</h1>
                </Container>
            </div>
        );
    }
}

export default PokeContainer;
